r(colorPercentage) ;  // assigns the background color here\n  }\n\n  calculateColor(percentageVal) {\n    if (percentageVal === 0) {  // if the value on the day is 0, assign the background as transparent\n      return 'transparent';\n    }\n\n    const colorRangeEnd = this.primaryColor;\n    const colorRangeStart = this.secondaryColor;\n    const percentFactor = (colorRangeEnd - colorRangeStart) * percentageVal;\n    const colorToApply = percentFactor + colorRangeStart;\n\n    // Return a CSS HSL string\n    return `hsl( ${colorToApply}, 100%, 50%)`;\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/WeekNumberPipe.html":{"url":"pipes/WeekNumberPipe.html","title":"pipe - WeekNumberPipe","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Pipes\n  WeekNumberPipe\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n\n        \n            File\n        \n        \n            projects/angular-year-calendar/src/lib/pipes/week-number/week-number.pipe.ts\n        \n\n\n\n        \n            Metadata\n            \n                \n                    \n                        Name\n                        weekNumber\n                    \n                \n            \n        \n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        \n                            getDayInView\n                        \n                        \n                    \n                \n            \n            \n                \ngetDayInView(date, weekStartsOn)\n                \n            \n\n\n            \n                \n                    Defined in projects/angular-year-calendar/src/lib/pipes/week-number/week-number.pipe.ts:77\n                \n            \n\n\n        